import Rome from './Home';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
function App() {
  return (
    <div >
    <BrowserRouter>
      <Routes>
        <Route path='/Rome' exact component={Rome} />
      </Routes>
    </BrowserRouter>


    </div>
  );
}

export default App;
